import React from "react";

const Navigation = ({ onRouteChange, isSignedIn }) => {

    if (isSignedIn){
      return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
        <p onClick={() => onRouteChange('home')} className="f3 pa3 dim black underline pointer">Sign out</p>
        </nav>
      )
    } else {
      return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
          <p onClick={() => onRouteChange('home')} className="f3 pa3 dim black underline pointer">Sign in</p>
          <p onClick={() => onRouteChange('register')} className="f3 pa3 dim black underline pointer">Register</p>
        </nav>
      );
    }
}

export default Navigation;
